import React from 'react';
import './App.css';
import GridContainer from './components/grid';
import Select from './components/select';

export default class GridApp extends React.Component {
  constructor() {
    super();
    this.state = {
      currState : null
    }
  }

  render() {
    return (
      <div>
        {console.log(this.state['currState'])}
        <Select getCurrState={(x) => this.setState({currState: x})}/>
        <GridContainer/>
      </div>
    );
  }
}
